import React, { Component } from 'react'
import Particles from "react-particles-js";
export class Particles_component extends Component
{
    render()
    {
        return (

            <div
                style={{
                    position: "absolute",
                    top: 0,
                    left: 0,
                    width: "100%",
                    height: "100%"
                }}
            >
                <Particles
                    params={{

                        interactivity: {
                            detectsOn: "canvas",
                            events: {
                                onHover: {
                                    enable: true,
                                    mode: "repulse"
                                },
                                onClick: {
                                    enable: true,
                                    mode: "bubble"
                                },
                                resize: true
                            },
                            modes: {
                                grab: {
                                    distance: 400,
                                    links: {
                                        opacity: 1
                                    }
                                },
                                bubble: {
                                    distance: 400,
                                    size: 40,
                                    duration: 2,
                                    opacity: 0.8
                                },
                                repulse: {
                                    distance: 200
                                },
                                push: {
                                    quantity: 4
                                },
                                remove: {
                                    quantity: 2
                                }
                            }
                        },
                        detectRetina: true,
                    }}
                />

            </div>
        )
    }
}

export default Particles_component
